INSERT INTO `sql_console_history` (`ID`, `QUERY`, `RUN_SCHEMA`, `MODIFY_UID`, `CREATE_UID`, `MODIFY_DATE`, `CREATE_DATE`) VALUES (1526,'select p.ID,p.CATEGORY_ID,c.NAME AS CATEGORY,p.PRODUCT_TITLE,p.DESCRIPTION,p.PRICE,p.CURRENCY_ID,cr.VALUE AS CURRENCY,p.STOCK,\r\n(SELECT i.IMG_FILE_NAME FROM product_images i WHERE i.PRODUCT_ID = p.ID AND i.ID = min(i.ID)) AS IMG\r\nfrom products p left join categories c on(p.category_id = c.id) left join\r\nlist_currency cr on (p.CURRENCY_ID = cr.ID)',7,1,1,'2020-11-07 12:01:49','2020-11-07 12:01:49');
