INSERT INTO `views` (`ID`, `MODULE_ID`, `VIEW_NAME`, `SCHEMA_ID`, `CREATE_VIEW_QUERY`, `DESCRIPTION`, `MODIFY_UID`, `CREATE_UID`, `MODIFY_DATE`, `CREATE_DATE`) VALUES (10,14,'view_tables_views',3,'create view view_tables_views as \r\n \r\nselect t.ID,t.SCHEMA_ID,\r\n(select list_databases.VALUE AS VALUE from list_databases where list_databases.ID = t.SCHEMA_ID) AS TABLE_SCHEMA,\r\nt.TABLE_NAME,\r\n\\\'TABLE\\\' AS \\\'TYPE\\\'\r\nfrom tables t where t.origin_id = 0 \r\nunion all\r\nselect t.ID,t.SCHEMA_ID,\r\n(select list_databases.VALUE AS VALUE from list_databases where list_databases.ID = t.SCHEMA_ID) AS TABLE_SCHEMA,\r\nt.VIEW_NAME AS \\\'TABLE_NAME\\\',\r\n\\\'VIEW\\\' AS \\\'TYPE\\\'\r\nfrom views t\r\norder by table_name','Tables and views',1,1,'2020-12-13 10:46:06','2020-12-13 10:46:06');
